import React, { Component } from 'react';

const HomeContainer = styled.div`
    margin: 0 auto;
    margin-top: 40px;
    width: 620px;
    height: 420px;
    box-shadow: 3px 3px 8px rgba(0,0,0,0.3);
`;

class Home extends Component {
    render() {
        return (
            <div>
                <HomeContainer></HomeContainer>
            </div>
        );
    }
}

export default Home;
